import styled from "styled-components";
import { Typography } from "@material-ui/core";

const ZappoTypography = styled(Typography)`
  && {
    font-family: "Bernardo Moda";
    font-size: 1.6rem;
    font-weight: bold;
    text-transform: uppercase;
  }
`;

export default ZappoTypography;
